def count_page(url):
    soup = BeautifulSoup(get_html(url), "lxml")
    if soup.select('body > main > div > div.pagination > a.num'):
        count_page = soup.select('body > main > div > div.pagination > a.num')
        a=int(len(count_page))
        if len(count_page) > 9:
            count_page2 = soup.select('body > main > div > div.pagination > a:nth-child(12)')
            b=int(count_page2[0]['href'].split('_')[1].split('.')[0])
            return b+1
        return a+1
    else:
        return 2


